package net.jeeshop.services.front.appSlaughter.dao;import java.util.List;import net.jeeshop.core.dao.BaseDao;import net.jeeshop.core.dao.page.PagerModel;import net.jeeshop.services.common.AppSlaughter;public class AppSlaughterDaoImpl implements AppSlaughterDao {	private BaseDao dao;	public void setDao(BaseDao dao) {		this.dao = dao;	}	@Override	public PagerModel selectPageList(AppSlaughter e) {		return dao.selectPageList("front.appSlaughter.selectPageList",				"front.appSlaughter.selectPageCount", e);	}	@Override	public List selectList(AppSlaughter e) {		return dao.selectList("front.appSlaughter.selectList", e);	}	@Override	public AppSlaughter selectOne(AppSlaughter e) {		return (AppSlaughter) dao.selectOne("front.appSlaughter.selectOne", e);	}	@Override	public int delete(AppSlaughter e) {		return dao.delete("front.appSlaughter.delete", e);	}	@Override	public int update(AppSlaughter e) {		return dao.update("front.appSlaughter.update", e);	}		@Override	public int insert(AppSlaughter e) {		return dao.insert("front.appSlaughter.insert", e);	}	@Override	public int deleteById(int id) {		return dao.delete("front.appSlaughter.deleteById", id);	}	@Override	public AppSlaughter selectById(String id) {		return (AppSlaughter) dao.selectOne("front.appSlaughter.selectById", id);	}}